"Dabartinei kainai (A) nukritus iki pavedimo limituotos kainos (C) arba dar žemiau pavedimas bus įvykdytas automatiškai. Pavedimas gali būti įvykdytas nedelsiant, jei pirkimo kaina yra aukštesnė už dabartinę kainą arba jai lygi. Todėl pavedimų nustatant ribą pirkimo kaina turi būti žemesnė už dabartinę kainą.
Pavyzdžiui: 1) dabartinė kaina aukščiau pateiktoje diagramoje yra 2 400 (A). Jei pateikiamas naujas pirkimo pavedimas / pavedimas nustatant ribą, kurio limituota kaina yra 1 500 (C), pavedimas nebus vykdomas, kol kaina nenukris iki %@;
2) o jei bus pateiktas pirkimo pavedimas / pavedimas nustatant ribą, kurio išankstinė kaina %@, tai yra didesnė už dabartinę kainą, pavedimas bus nedelsiant išpildytas konkuruojančia kaina. Išpildymo kaina bus apie 2 400, o ne 3 000."

"Dabartinei kainai (A) padidėjus iki pavedimo limituotos kainos (B) arba ją viršijus pavedimas bus įvykdytas automatiškai. Pavedimas gali būti įvykdytas nedelsiant, jei pardavimo kaina yra mažesnė už dabartinę kainą arba jai lygi. Todėl pavedimų nustatant ribą pardavimo kaina turi būti didesnė už dabartinę kainą.
