"Pavyzdys.
1) Dabartinė kaina anksčiau pateiktoje diagramoje yra 2 400 (A). Jei pateikiamas naujas pirkimo pavedimas / limituotas pavedimas, kurio limituota kaina yra 1 500 (C), pavedimas nebus vykdomas, kol kaina nenukris iki %@;

2) o jei bus pateiktas pirkimo pavedimas / limituotas pavedimas, kurio limituota kaina %@, t. y. didesnė už dabartinę kainą, pavedimas bus nedelsiant įvykdytas rinkos kaina. Įvykdymo kaina bus apie 2 400, o ne 3 000."

"Dabartinei kainai (A) padidėjus iki pavedimo išankstinės kainos (B) arba ją viršijus pavedimas bus įvykdytas automatiškai. Pavedimas gali būti įvykdytas nedelsiant, jei pardavimo kaina yra mažesnė už dabartinę kainą arba jai lygi. Todėl pavedimų nustatant ribą pardavimo kaina turi būti didesnė už dabartinę kainą.
Pavyzdžiui: 1) dabartinė kaina aukščiau pateiktoje diagramoje yra 2 400 (A), jei pateikiamas naujas pardavimo pavedimas / pavedimas nustatant ribą, kurio išankstinė kaina yra 3 000 (B), pavedimas nebus vykdomas, kol kaina nepakils iki %@;
2) o jei pateikiamas pardavimo pavedimas / pavedimas nustatant ribą, kurio išankstinė kaina %@, tai yra mažesnė už dabartinę kainą, pavedimas būtų nedelsiant įvykdytas konkuruojančia kaina; įvykdymo kaina būtų apie 2 400, o ne 1 500."

"Pavyzdžiui:
1) dabartinė kaina anksčiau pateiktoje diagramoje yra 2 400 (A), jei pateikiamas naujas pardavimo pavedimas / limituotas pavedimas, kurio limituota kaina yra 3 000 (B), pavedimas nebus vykdomas, kol kaina nepakils iki %@;

2) o jei pateikiamas pardavimo pavedimas / limituotas pavedimas, kurio limituota kaina %@, t. y. mažesnė už dabartinę kainą, pavedimas būtų nedelsiant įvykdytas rinkos kaina; įvykdymo kaina būtų apie 2 400, o ne 1 500."

"Dabartinė kaina 2 400. Jei pateikiate rinkos pavedimą, jūsų pavedimas bus nedelsiant įvykdytas %@, tai reiškia, kad vidutinė įvykdymo kaina nebus lygi 2 400 (A), kuri turėtų būti šiek tiek mažesnė arba didesnė nei 2 400.
Pastaba: 1) pirkimo pavedimų vidutinė įvykdymo kaina gali būti šiek tiek didesnė nei dabartinė kaina. O pardavimo pavedimų vidutinė įvykdymo kaina gali būti šiek tiek mažesnė nei dabartinė kaina;
2) pateikdami rinkos pavedimą, norėdami pirkti arba parduoti, turite pasirinkti [Suma] arba [Iš viso]."

"Norėdami įjungti lengvą prekybą, turite:

1. uždaryti savo izoliuotas pozicijas klasikiniu prekybos režimu;
2. perjungti į kelių išteklių režimą."
